  render() {
    return (
      <div className="container my-5">
        <h1 className="my-4">NewsMonkey - Top Headlines</h1>
        <div className="row">
            <NewsItem title="myTitle" description="myDesc" />
            <NewsItem />
            <NewsItem />
            <NewsItem />
            <NewsItem />
            <NewsItem />
            <NewsItem />
        </div>
      </div>
    )
  }
}
